  "biography": {
    "it": "Enzo Cucchi nasce a Morro d\u2019Alba nel 1949, attualmente lavora e vive a Roma.\nConsiderato l\u2019artista pi\xF9 visionario tra gli esponenti della Transavanguardia, Enzo Cucchi diviene, a partire dagli anni Ottanta, artista di fama internazionale.\nDopo gli esordi in ambito concettuale, approda alla figurazione, diventando uno dei pi\xF9 importanti esponenti della Transavanguardia. Nelle opere su tela, accompagnate da numerosi disegni e spesso presentate da testi poetici scritti da lui stesso, si riappropria, con sguardo visionario, del mito della storia dell\u2019Arte e della letteratura.\nD\xE0 inoltre vita a composizioni di intensit\xE0 simbolica, nelle quali il mondo \xE8 rappresentato come campo di battaglia tra due principi opposti. \nSi form\xF2 da autodidatta dedicandosi alla pittura e alla poesia. Dalla met\xE0 degli anni Settanta, trasferitosi a Roma, dopo una ricerca orientata verso il concettualismo, espressa in varie installazioni, si \xE8 rivolto alla pittura, lavorando a stretto contatto con S. Chia e F. Clemente. ",
    "zh": "\u610F\u5927\u5229\u827A\u672F\u5BB6\u3001\u8BD7\u4EBA\u3001\u5EFA\u7B51\u5E08\uFF0C1949\u5E74\u51FA\u751F\u4E8E\u610F\u5927\u5229\u5B89\u79D1\u7EB3\u7701\u7684\u83AB\u7F57\u963F\u5C14\u5DF4\uFF0C\u4ED6\u662F\u8457\u540D\u7684\u610F\u5927\u5229\u8D85\u524D\u536B\u827A\u672F\u8FD0\u52A8\u7684\u5173\u952E\u4EBA\u7269\u4E4B\u4E00\uFF0C\u572820\u4E16\u7EAA80\u5E74\u4EE3\u548C\u6851\u5FB7\u7F57\xB7\u57FA\u4E9A\u3001\u5F17\u6717\u897F\u65AF\u79D1\xB7\u514B\u83B1\u8499\u7279\u5E76\u79F0\u4E3A\u610F\u5927\u5229\u8D85\u524D\u536B\u827A\u672F\u201C3C\u201D\u30021986\u5E74\uFF0C\u7EBD\u7EA6\u53E4\u6839\u6D77\u59C6\u535A\u7269\u9986\u4E3A\u4ED6\u4E3E\u529E\u4E86\u9996\u4E2A\u4E2A\u4EBA\u827A\u672F\u56DE\u987E\u5C55\uFF0C\u4ED6\u7684\u4F5C\u54C1\u591A\u88AB\u4E16\u754C\u77E5\u540D\u5F53\u4EE3\u827A\u672F\u673A\u6784\u6536\u85CF\uFF0C\u8BF8\u5982\u7EBD\u7EA6\u73B0\u4EE3\u827A\u672F\u535A\u7269\u9986\u3001\u4F26\u6566\u6CF0\u7279\u7F8E\u672F\u9986\u3001\u829D\u52A0\u54E5\u827A\u672F\u5B66\u9662\u7B49\u30021994\u5E74\u53C2\u4E0E\u8FC7\u4F4D\u4E8E\u745E\u58EB\u5362\u52A0\u8BFA\uFF08Lugano\uFF09\u7684\u8499\u7279\u5854\u739B\u7F57\u5723\u6BCD\u739B\u5229\u4E9A\u6559\u5802\u5185\u90E8\u88C5\u9970\u4FEE\u5EFA\u3002\u73B0\u5DE5\u4F5C\u751F\u6D3B\u4E8E\u610F\u5927\u5229\u7F57\u9A6C\u3001\u5B89\u79D1\u7EB3\u3002\n\u5E93\u5947\u8457\u79F0\u4E8E\u5176\u751F\u52A8\u7EDA\u70C2\u53C8\u9690\u542B\u75AF\u72C2\u7684\u8272\u5F69\uFF0C\u4EE5\u53CA\u5BF9\u751F\u547D\u7684\u601D\u8003\uFF0C\u63A2\u6C42\uFF0C\u6B23\u559C\uFF0C\u548C\u6323\u624E\uFF0C\u9163\u7545\u6DCB\u6F13\u7684\u8BB0\u5F55\u3002\u4ED6\u628A\u827A\u672F\u770B\u4F5C\u662F\u795E\u5723\u7684    \uFF0C\u800C\u521B\u4F5C\u7684\u8FC7\u7A0B\u662F\u5B55\u80B2\u795E\u5723\u7684\u4EEA\u5F0F\uFF0C\u5E93\u5947\u66FE\u8BF4\u8FC7\uFF1A\u201C\u6211\u8BD5\u56FE\u53BB\u521B\u9020\u4E00\u79CD\u795E\u5723\u4E0D\u53EF\u4FB5\u72AF\u7684\u611F\u89C9\uFF0C\u56E0\u4E3A\u827A\u672F\u521B\u4F5C\u4E0D\u5149\u662F\u5236\u9020\u51FA\u4E00\u4EF6\u7269\u54C1\u6216\u4E8B\u5B9E\uFF0C\u800C\u662F\u4F60\u4E3A\u4F60\u7684\u5949\u732E\u6807\u6CE8\u4E00\u4E2A\u6807\u8BB0\u3002\u4F60\u9700\u8981\u611F\u89C9\u50CF\u52A0\u5165\u4E00\u4E2A\u5B97\u6559\u5E2E\u6D3E\u4E00\u6837\uFF0C\u9075\u4ECE\u7740\u90A3\u6839\u53D1\u51FA\u6307\u4EE4\u7684\u795E\u68CD\uFF0C\u8BA9\u81EA\u5DF1\u7F6E\u8EAB\u4E8E\u4E00\u4E2A\u6709\u7740\u89C4\u77E9\u548C\u6CD5\u5219\u7684\u795E\u5723\u7684\u5730\u5E26\u3002\u201D",
    "en": "(born 14 November 1949) is an Italian painter. A native of Morro d'Alba, province of Ancona, he was a key member of the Italian Transavanguardia movement, along with his countrymen Francesco Clemente, Mimmo Paladino, Nicola De Maria and Sandro Chia. The movement was at its peak during the 1980s and was part of a wider movement of Neo-Expressionists painters around the world.\nCucchi's first major Retrospective was held at the Solomon R. Guggenheim Museum, New York 1986 and his works are held in numerous museum collections including the Museum of Modern Art New York, the Tate London and the Art Institute of Chicago. Cucchi lives and works in Rome and Ancona."
  },
