    "it": "Sandro Chia nasce a Firenze nel 1946, attualmente vive e lavora tra New York e Montalcino.\nE’ un artista, pittore e scultore italiano. E' stato uno dei più importanti membri del movimento della Transavanguardia italiana.\nHa realizzato opere di grande formato, caratterizzate dall'uso di impasti cromatici corposi e accesi e da un segno pittorico forte e dinamico, frequentemente popolate da eroiche figure maschili che tornano anche nelle sculture in bronzo, spesso dipinte in colori vivaci. \nHa una formazione artistica molto eterogenea: nel 1969 si diploma all'Accademia di Belle Arti di Firenze dove entra in contatto con le principali avanguardie europee e statunitensi. Dopo aver viaggiato in Asia e in Europa, sul finire degli anni '70 si convertirà al figurativismo inserendosi così alla Transavanguardia. ",
    "zh": "1946年出生于意大利的佛罗伦萨，意大利超前卫画派的代表艺术家之一。在皮蒂宫艺术学院和佛罗伦萨美术学院完成学业后，去欧洲各地和印度游历。1970年回到罗马后，开始了艺术家生活。1971年在罗马La Salita画廊举办首次个展。1980年9月至1981年8月获得德国格拉德巴赫市的奖学金得以在该地工作一年，1982年移居纽约，现往来居住于美国的迈阿密、意大利的罗马和蒙塔尔奇诺之间。\n他是意大利“跨国传教”运动的一部分，在世界许多最重要的博物馆和画廊中展出。他曾在巴黎和圣保罗双年展和威尼斯双年展三次。他的工作已经成为国际知名博物馆小组展的一部分。他最重要的个人表演是在阿姆斯特丹Stedelijk博物馆（1983年），纽约大都会博物馆（1984年），柏林国家画廊（1984年，1992年），巴黎现代艺术博物馆（1984年）等展览。杜塞尔多夫博物馆（1984年），安特卫普（1989年），墨西哥城（1989年）;佛罗伦萨宫（Palazzo Medici Riccardi）（1991）;卡尔斯鲁厄博物馆（1992），棕榈泉（1993），罗马Villa Medici（1995）;佛罗里达州博卡拉顿艺术博物馆（1997），锡耶纳Galleria Civica（1997年），特伦托广场（2000年），拉文纳博物馆博物馆（2000年）;佛罗伦萨Palazzo Pitti和佛罗伦萨考古博物馆考古博物馆（2002）;最近最近在彼得拉桑达（2005年）的圣阿戈斯蒂诺大教堂和罗马广场（GNAM）的国际艺术博览会（GNAM）（2010年）。",
    "en": "Sandro Chia Born in Florence (20 April 1946), Italy, was one of the foremost artists during the resurgent interest in painting in the 1980s. He established himself as a major artist of the movement in Italian figurative painting known as the Transavanguardia, a Neo-Expressionist movement that sought to re-emphasize color and representation in reaction to the Conceptual Art of the times. His works were exhibited in many of the most important museums and galleries of the world, and featured in almost every major museum exhibition benchmarking that era including Zeitgeist in 1982. In a career spanning over four decades, some of the exhibition milestones include the Biennale of Paris, San Paolo and three different iterations of the Venice Biennale."
